 for (var i = 0; i < obj.ranges.length - 1; i++) {
  str += obj.ranges[i].min + ' to ' + obj.ranges[i].max + ',\n'
 }
 if (obj.ranges.length > 1) {
  str += 'or ';
 }
 str += obj.ranges[obj.ranges.length - 1].min + ' to ' + obj.ranges[obj.ranges.length - 1].max
 return str;
})()

(function() {
 var code = parseInt(data('item_pack_barcode'));
 var json = JSON.parse(data('ranges'));
 var valid = 'false';
 var i = 0;
 while (valid == 'false' && i < json.ranges.length) {
  if ((json.ranges[i].min <= code) && (json.ranges[i].max >= code)) {
   valid = 'true';
  }
  i++;
 }
 return valid;
})()

